`,stats:{STR:15,DEX:14,CON:12,INT:1,WIS:10,CHA:3}},{id:"tatyunhxv",name:"Copper Dragon Wyrmling",hp:22,AC:16,type:"dragon",speed:30,speedSwim:10,speedFly:60,immunities:["Acid"],resistances:[],vulnerabilities:[],savingThrows:["DEX +3","CON +3","WIS +2","CHA +3"],skills:["Perception +4","Stealth +3"],senses:["Blindsight 10 ft.","Darkvision 60 ft.","Passive Perception 14"],challenge:"1 (200 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/255/1000/1000/636252768002215182.jpeg",size:"medium",alignment:"chaotic good",isPlayer:!1,notes:`
