`,stats:{STR:22,DEX:11,CON:20,INT:8,WIS:6,CHA:10}},{id:"xroysq2ma",name:"Darkmantle",hp:22,AC:11,type:"monstrosity",speed:10,speedSwim:10,speedFly:30,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Stealth +3"],senses:["Blindsight 60 ft.","Passive Perception 10"],challenge:"1/2 (100 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/263/315/315/636252768676699519.jpeg",size:"small",alignment:"unaligned",isPlayer:!1,notes:`
