`,stats:{STR:18,DEX:10,CON:12,INT:2,WIS:11,CHA:7}},{id:"futj3ihe0",name:"Dragon Turtle",hp:341,AC:20,type:"dragon",speed:20,speedSwim:40,speedFly:0,immunities:[],resistances:["Fire"],vulnerabilities:[],savingThrows:["DEX +6","CON +11","WIS +7"],skills:[],senses:["Darkvision 120 ft.","Passive Perception 11"],challenge:"17 (18,000 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/291/1000/1000/636252771128151641.jpeg",size:"gargantuan",alignment:"neutral",isPlayer:!1,notes:`
