`,stats:{STR:16,DEX:16,CON:18,INT:13,WIS:14,CHA:12}},{id:"962a117x6",name:"Drow",hp:13,AC:15,type:"humanoid",speed:30,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Perception +2","Stealth +4"],senses:["Darkvision 120 ft.","Passive Perception 12"],challenge:"1/4 (50 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/16/501/1000/1000/636376310726273495.jpeg",size:"medium",alignment:"neutral evil",isPlayer:!1,notes:`
