`,stats:{STR:22,DEX:12,CON:24,INT:16,WIS:15,CHA:16}},{id:"0vs46ejwh",name:"Elephant",hp:76,AC:12,type:"beast",speed:40,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Passive Perception 10"],challenge:"4 (1,100 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/attachments/2/648/beast.jpg",size:"huge",alignment:"unaligned",isPlayer:!1,notes:`
