`,stats:{STR:22,DEX:9,CON:17,INT:3,WIS:11,CHA:6}},{id:"2mw0rxh55",name:"Elk",hp:13,AC:10,type:"beast",speed:50,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Passive Perception 10"],challenge:"1/4 (50 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/attachments/2/648/beast.jpg",size:"large",alignment:"unaligned",isPlayer:!1,notes:`
