`,stats:{STR:17,DEX:12,CON:14,INT:6,WIS:13,CHA:6}},{id:"5uif4w6jf",name:"Hezrou",hp:136,AC:16,type:"fiend",speed:30,speedSwim:10,speedFly:0,immunities:["Poison","Poisoned"],resistances:["Cold","Fire","Lightning; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks"],vulnerabilities:[],savingThrows:["STR +7","CON +8","WIS +4"],skills:[],senses:["Darkvision 120 ft.","Passive Perception 11"],challenge:"8 (3,900 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/321/315/315/636252775562934524.jpeg",size:"large",alignment:"chaotic evil",isPlayer:!1,notes:`
