`,stats:{STR:14,DEX:13,CON:13,INT:1,WIS:10,CHA:4}},{id:"agm8sk2xy",name:"Remorhaz",hp:195,AC:17,type:"monstrosity",speed:30,speedSwim:10,speedFly:0,immunities:["Cold","Fire"],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 60 ft.","Tremorsense 60 ft.","Passive Perception 10"],challenge:"11 (7,200 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/231/315/315/636252766143328421.jpeg",size:"huge",alignment:"unaligned",isPlayer:!1,notes:`
