`,stats:{STR:2,DEX:11,CON:8,INT:1,WIS:8,CHA:2}},{id:"95atgje8b",name:"Scout",hp:16,AC:13,type:"humanoid",speed:30,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Nature +4","Perception +5","Stealth +6","Survival +5"],senses:["Passive Perception 15"],challenge:"1/2 (100 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/163/1000/1000/636252759915100020.jpeg",size:"medium",alignment:"any",isPlayer:!1,notes:`
