`,stats:{STR:4,DEX:16,CON:11,INT:2,WIS:8,CHA:6}},{id:"571rxcv1e",name:"Stone Giant",hp:126,AC:17,type:"giant",speed:40,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:["DEX +5","CON +8","WIS +4"],skills:["Athletics +12","Perception +4"],senses:["Darkvision 60 ft.","Passive Perception 14"],challenge:"7 (2,900 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/109/315/315/636252744518731463.jpeg",size:"huge",alignment:"neutral",isPlayer:!1,notes:`
