`,stats:{STR:23,DEX:15,CON:20,INT:10,WIS:12,CHA:9}},{id:"i8y79i4zk",name:"Stone Golem",hp:178,AC:17,type:"construct",speed:30,speedSwim:10,speedFly:0,immunities:["Poison","Psychic; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks that aren't Adamantine","Charmed","Exhaustion","Frightened","Paralyzed","Petrified","Poisoned"],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 120 ft.","Passive Perception 10"],challenge:"10 (5,900 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/107/315/315/636252743780112834.jpeg",size:"large",alignment:"unaligned",isPlayer:!1,notes:`
