`,stats:{STR:18,DEX:12,CON:15,INT:2,WIS:8,CHA:5}},{id:"d5pb8dlzw",name:"Water Elemental",hp:114,AC:14,type:"elemental",speed:30,speedSwim:90,speedFly:0,immunities:["Poison","Exhaustion","Grappled","Paralyzed","Petrified","Poisoned","Prone","Restrained","Unconscious"],resistances:["Acid; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks"],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 60 ft.","Passive Perception 10"],challenge:"5 (1,800 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/84/315/315/636252736680781387.jpeg",size:"large",alignment:"neutral",isPlayer:!1,notes:`
