`,stats:{STR:15,DEX:14,CON:16,INT:10,WIS:13,CHA:15}},{id:"2j2npi5vo",name:"Will-o'-Wisp",hp:22,AC:19,type:"undead",speed:0,speedSwim:10,speedFly:50,immunities:["Lightning","Poison","Exhaustion","Grappled","Paralyzed","Poisoned","Prone","Restrained","Unconscious"],resistances:["Acid","Cold","Fire","Necrotic","Thunder; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks"],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 120 ft.","Passive Perception 12"],challenge:"2 (450 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/16/585/315/315/636376363763232290.jpeg",size:"tiny",alignment:"chaotic evil",isPlayer:!1,notes:`
